import { Drawer, DrawerBody, DrawerCloseButton, DrawerContent, DrawerOverlay } from "@chakra-ui/modal";
import { VFC } from "react";

export const MenuDrawer: VFC = () => {

    return (
        <Drawer>
            <DrawerOverlay>
                <DrawerContent>
                    <DrawerBody></DrawerBody>
                    <DrawerCloseButton />
                </DrawerContent>
            </DrawerOverlay>
        </Drawer>
    );
};
